import { Component } from "react";
import './PostBoxStyle.css';

export default class PostBox extends Component{
    constructor(props){
        super(props);

    }

    render(){
        return(
            <div id="postOuterDiv">
                <h2>
                    {this.props.title}
                </h2>
                <p>
                    {this.props.description}
                </p>
            </div>
        );
    }
}
